            {props.name}
        </div>
        <div className='description'>
            {props.description}
        </div>
        <div className='id'>
            Код товару: {props.id}
        </div>
        <div className='cost'>
            
        </div>
        {props.sale?<div className='cost'>
            <div className='sale'>{props.cost}₴</div>
            {props.sale}₴
        </div>:<div className='cost'>
            {props.cost}₴
        </div>}
        
    </div>
  )
}
